import { PayPalButtons, PayPalScriptProvider } from "@paypal/react-paypal-js";
import React from "react";

const PaypalScreen = () => {
  return (
    <div>
      <PayPalScriptProvider>
        <PayPalButtons />
      </PayPalScriptProvider>
    </div>
  );
};

export default PaypalScreen;
